import React, { useState } from "react";
import ApiService from "../../service/ApiService";

const PrediccionPage = () => {
  const [form, setForm] = useState({
    numAdultos: 2,
    numNinos: 1,
    tipoHabitacion: "Doble",
    precioHabitacion: 100.0,
    duracionEstadia: 3,
    diaSemanaCheckIn: "Friday",
    mesCheckIn: 4,
    antiguedadReserva: 60,
  });

  const [resultado, setResultado] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    const parsedValue =
      ["tipoHabitacion", "diaSemanaCheckIn"].includes(name) ? value : Number(value);
    setForm((prev) => ({
      ...prev,
      [name]: parsedValue,
    }));
  };

  const handlePredecir = async () => {
    try {
      setLoading(true);
      const resultadoPrediccion = await ApiService.predecirCancelacion(form);
      setResultado(resultadoPrediccion);
    } catch (error) {
      alert("Error al obtener la predicción.");
      console.error(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-4 max-w-xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">Predicción de Cancelación</h1>

      <form className="space-y-3">
        <div className="grid grid-cols-2 gap-4">
          <input
            name="numAdultos"
            type="number"
            value={form.numAdultos}
            onChange={handleChange}
            placeholder="Número de adultos en la reserva"
            className="border p-2 rounded"
          />
          <input
            name="numNinos"
            type="number"
            value={form.numNinos}
            onChange={handleChange}
            placeholder="Número de niños en la reserva"
            className="border p-2 rounded"
          />
          <select
            name="tipoHabitacion"
            value={form.tipoHabitacion}
            onChange={handleChange}
            className="border p-2 rounded"
          >
            <option value="Doble">Doble - 2 camas</option>
            <option value="Simple">Simple - 1 cama</option>
            <option value="Suite">Suite - de lujo</option>
          </select>
          <input
            name="precioHabitacion"
            type="number"
            step="0.01"
            value={form.precioHabitacion}
            onChange={handleChange}
            placeholder="Precio total de la habitación en USD"
            className="border p-2 rounded"
          />
          <input
            name="duracionEstadia"
            type="number"
            value={form.duracionEstadia}
            onChange={handleChange}
            placeholder="Cantidad de noches que durará la estadía"
            className="border p-2 rounded"
          />
          <select
            name="diaSemanaCheckIn"
            value={form.diaSemanaCheckIn}
            onChange={handleChange}
            className="border p-2 rounded"
          >
            <option value="Monday">Lunes</option>
            <option value="Tuesday">Martes</option>
            <option value="Wednesday">Miércoles</option>
            <option value="Thursday">Jueves</option>
            <option value="Friday">Viernes</option>
            <option value="Saturday">Sábado</option>
            <option value="Sunday">Domingo</option>
          </select>
          <input
            name="mesCheckIn"
            type="number"
            min="1"
            max="12"
            value={form.mesCheckIn}
            onChange={handleChange}
            placeholder="Mes de llegada (1 = Enero, 12 = Diciembre)"
            className="border p-2 rounded"
          />
          <input
            name="antiguedadReserva"
            type="number"
            value={form.antiguedadReserva}
            onChange={handleChange}
            placeholder="Días entre la reserva y la fecha de llegada"
            className="border p-2 rounded"
          />
        </div>

        <button
          type="button"
          onClick={handlePredecir}
          className="bg-blue-600 text-white px-4 py-2 rounded w-full"
          disabled={loading}
        >
          {loading ? "Procesando..." : "Predecir Cancelación"}
        </button>
      </form>

      {resultado && (
        <div className="mt-6 p-4 border rounded bg-gray-50">
          <p><strong>¿Cancelará?</strong> {resultado.cancelara ? "Sí" : "No"}</p>
          <p><strong>Confianza:</strong> {Math.round(resultado.confianza * 100)}%</p>
        </div>
      )}
    </div>
  );
};

export default PrediccionPage;
